export function About(props) {
    if (props.about) {
        return null;
    }

    return (
        <div className="about-container">
            <p className="pointer" onClick={this.resumeclick}>
                        {this.state.showResume ? 'Resume' : 'Resume'}
                    </p>
            this section under construction
        </div>
    );
}

export default About;
